(320, 'U176', NULL, 'STATUS', NULL, 'Dear All,\r\nMình chính thức là thành viên NKD từ 1/11/2016. Nhưng do một chút trục trặc nên giờ mới chào hỏi mọi người được.\r\nHân hạnh được làm việc với Ban giám đốc và tất cả Anh, Chị, Em gia đình NKD. Rất mong được mọi người hỗ trợ để có được hiệu quả công việc tốt nhất.\r\nTrân trọng,\r\nMai Ngọc Quang,', 0, 0, '0', 1, '{"count":1,"data":{"like":1}}', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 'OPEN', '', NULL, 0, '2016-11-04 22:46:17', '2016-11-04 22:46:17', NULL, NULL, 176, 176),
