(599, '321', 'U148', 'STATUS', NULL, 'Hi all,\r\nMọi người update công việc ở mục dự án, nếu có tài liệu đính kèm ( BOQ, Hồ sơ kỹ thuật, datasheet...)  thì đính kèm vào nhé, báo giá thì có thể đính kèm hoặc không. Mục đích để những người quan tâm biết khối lượng, ước lượng giá trị cũng như nhiều thông tin khác.\r\nthanks', NULL, 'SHOW', '0', NULL, '2016-11-05 08:27:39', '2016-11-05 08:27:39'),
